sources.src/SearchButton.js:
import React from 'react';
import './SearchButton.less';

class SearchButton extends React.Component{
    constructor(props){
        super(props);

        this.buttonValue = {
            value: props.value
        };

        this.printName = this.printName.bind(this);
    }

    printName(){
        alert(this.props.keyword);
    }

    render() {
        return (
            <button onClick={this.printName}>{this.buttonValue.value}</button>
        );
    }
}

export default SearchButton;
